import React from "react";
import ReactDOM from "react-dom";

class Navbar extends React.Component {
  render() {
    return (
      <div>
        <nav className="mainNav">
          <a href="">Home</a>
          <a href="">About Me</a>
          <a href="">My Work</a>
          <a href="">Contact Me</a>
        </nav>
      </div>
    );
  }
}

export default Navbar;
